import { useEffect, useState } from "react"
import '../Style/crypto.css'


export const BitcoinComponent: React.FC = () => {

    const [BTC, setBTC] = useState<String>()

    useEffect(() => {
        const pricesWs = new WebSocket('wss://ws.coincap.io/prices?assets=bitcoin')

        pricesWs.onmessage = msg => {
            const value = JSON.parse(msg.data)
            setBTC(Object.values(value).toString())
        }

        return () => {
            pricesWs.close();
        }
    })

    return(
        <div className="crypto-container">
            <p className="crypto-name">Bitcoin</p>
            <section>
                <p className="crypto-in-USD">{BTC}</p>
            </section>
        </div>
    )
}
